// src/components/TripList.js
import React, { useEffect, useState } from 'react';
import TripCard from './TripCard';
import '../styles/TripList.css';

const mockTrips = [
  {
    id: '1',
    title: 'Goa Beach Escape',
    description: 'Relax on sunny beaches and enjoy vibrant nightlife.',
    price: 8999,
    image: 'https://source.unsplash.com/600x400/?beach,goa'
  },
  {
    id: '2',
    title: 'Manali Mountain Adventure',
    description: 'Explore the Himalayan mountains and scenic valleys.',
    price: 10999,
    image: 'https://source.unsplash.com/600x400/?mountains,manali'
  },
  {
    id: '3',
    title: 'Kerala Backwaters',
    description: 'Houseboat cruises and lush green landscapes await you.',
    price: 9999,
    image: 'https://source.unsplash.com/600x400/?kerala,backwaters'
  }
];

const TripList = () => {
  const [trips, setTrips] = useState([]);

  useEffect(() => {
    // Simulate fetching from an API
    setTimeout(() => {
      setTrips(mockTrips);
    }, 500);
  }, []);

  return (
    <div className="trip-list-container">
      <h2>Available Trips</h2>
      <div className="trip-grid">
        {trips.map(trip => (
          <TripCard key={trip.id} trip={trip} />
        ))}
      </div>
    </div>
  );
};

export default TripList;
